(function(window){"use strict";function storageAvailable(type){try{const storage=window[type];const x="__storage_test__";storage.setItem(x,x);storage.removeItem(x);return true}catch(e){return false}}window.uSizyUniversal={URL:"https://usizy.com",init:init,push:function(event){let oReq=new XMLHttpRequest;oReq.open("POST",window.uSizyUniversal.URL+"/external/pageview",true);oReq.withCredentials=true;let data=new FormData;for(let p in event){if(event.hasOwnProperty(p)){data.append(p,event[p])}}let sk;if(storageAvailable("localStorage")){sk=window.top.localStorage.getItem("usizy.sk")}if(!sk){sk=window.top.document.cookie.replace(/(?:(?:^|.*;\s*)usizy\.sk\s*=\s*([^;]*).*$)|^.*$/,"$1")}if(sk){data.append("sk",sk)}oReq.onload=function(e){if(this.status===200){let sk=this.responseText;if(storageAvailable("localStorage")){window.top.localStorage.setItem("usizy.sk",sk)}window.top.document.cookie="usizy.sk="+sk+"; path=/; max-age=315360000"}};oReq.send(data)}};function init(){uSizyUniversal.push({event:"PAGEVIEW",ref:window.top.location})}try{const manualInit=document.currentScript.dataset.manual_init;if(!manualInit){init()}}catch(e){init()}})(window);